import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
import './Textcontent.css';

const Textcontent = () => {
    return(
        <div className='Textcontent'>
            <Route>
                <Switch>
                    <Route exact path="/myfirst">
                        <OpenSSH />
                    </Route>
                </Switch>
            </Route>
        </div>
     )
};

export default Textcontent;
